import {Footer} from './components/footer'
import {Header} from './components/header'

import RouteSwitch from './RouteSwitch';
import { createContext, useState } from 'react';

export const myCart = createContext(null);
export const first = createContext(false);

function App() {
  const [MyCarts, setMyCarts] = useState(null);

  return (
    <>
    <myCart.Provider value={MyCarts}>
      <Header />
        <RouteSwitch />
      <Footer />
    </myCart.Provider>
    </>
  );
}

export default App
export const bag = createContext([]);
